CREATE TABLE IF NOT EXISTS test_runs (
    -- Identifiant unique d'une exécution complète
    run_id SERIAL PRIMARY KEY,
    
    -- Contexte
    git_commit_hash VARCHAR(40) NOT NULL,
    git_branch VARCHAR(100) NOT NULL,
    ci_run_id VARCHAR(100),
    environment VARCHAR(20) NOT NULL,
    
    -- Résultats agrégés
    total_tests INTEGER NOT NULL,
    passed_tests INTEGER NOT NULL,
    failed_tests INTEGER NOT NULL,
    skipped_tests INTEGER NOT NULL,
    total_duration_ms INTEGER,
    
    -- Statut global
    overall_status VARCHAR(20),               -- passed | failed
    gate_1_status VARCHAR(20),
    gate_2_status VARCHAR(20),
    gate_3_status VARCHAR(20),

    -- Métadonnées
    started_at TIMESTAMP NOT NULL,
    completed_at TIMESTAMP,
    created_by VARCHAR(100),
    
    -- Relation avec test_logs
    CONSTRAINT fk_test_logs 
        FOREIGN KEY (run_id) 
        REFERENCES test_runs(run_id) 
        ON DELETE CASCADE
);

-- Modifier test_logs pour ajouter la FK
ALTER TABLE test_logs ADD COLUMN run_id INTEGER;
ALTER TABLE test_logs ADD CONSTRAINT fk_run 
    FOREIGN KEY (run_id) REFERENCES test_runs(run_id);



